import React, { useState } from 'react';
import { Link, useHistory } from 'react-router-dom';
import './style.css';
import api from '../../services/api';

function Profile(){
    const history = useHistory();
    const initUser = {
        name:'',
        email:'',
        idade:0,
        empresa:'',
        banco:'',
        agencia:'',
        saldo:''
    }
    
    function onSubmit(ev){
        
    }

    const [user, setUser] = useState(initUser);
    return(
        <div id="profile-container">
            <h1>Cadastro de Usuário</h1>
            <form onSubmit={onSubmit}>
                <strong>Nome:</strong>
                <input placeholder="Insira seu nome..." name="name" required></input>
                <strong>E-mail:</strong>
                <input placeholder="ex: abcdefgh@gmail.com" type="email" name="email" required></input>
                <strong>Idade:</strong>
                <input placeholder="0" min="18" max="120" type="number" name="idade" required></input>
                <strong>Empresa:</strong>
                <input placeholder="ex: Universidade Estadual do Sudoeste da Bahia" name="empresa" required></input>
                <strong>Banco:</strong>
                <input placeholder="ex: Banco do Brasil" name="banco" required></input>
                <strong>Agência:</strong>
                <input placeholder="ex: 0060-4" name="agencia" required></input>
                <strong>Saldo:</strong>
                <input placeholder="ex: 989898.58" type="number" name="saldo" required></input>
                <div className="actions">
                    <Link className="button" onClick={()=>history.push('/')}>Voltar</Link>
                    <button className="button" type="submit">Salvar</button>
                </div>
            </form>

        </div>
    );
}

export default Profile;
